const fetchItems = async () => {
  try {
    const response = await axios.get('http://localhost:8080/mvc/stuff/item/list', {
      withCredentials: true
    });
    setItems(response.data);
  } catch (error) {
    console.error('물건 목록 로딩 실패:', error);
    alert('물건 목록을 불러오는데 실패했습니다.');
  }
};
